import React from 'react';
import './OnBoarding.css'; // Make sure to create this CSS file
import topImage from './Assets/onboarding_1.png'; // import the image
import bottomImage from './Assets/bottom-image.png'; // replace with your actual bottom image file path

function OnBoarding() {
  return (
    <div className="screen">
      <img className="top-image" src={topImage} alt="Top" />
      <div className="center-content">
        <p className="center-text">Your text here</p>
      </div>
      <img className="bottom-image" src={bottomImage} alt="Bottom" />
    </div>
  );
}

export default OnBoarding;
